The last thing to mention is that because of the nature of executing a program line-by-line, compiled languages are often much faster than interpreted languages. For instance, let's compare two programs that do the exact same thing in two languages. You know the deal: vim test.c #include <stdio.h> int main()
{ int temp = 0; for(int i = 0; i < 1000000000; i++); temp += 1; return temp;
} gcc test.c -o test Now let's write the python version: vim test.py #!/usr/bin/env python3
def main(): temp = 0 for i in range(1000000000): temp += 1 return temp main() chmod +x test.py Now we have two versions, test.py and test -- a compiled vs interpreted race. Both of these programs run the action "increment temp" 1 billion times . For the C program, this is nothing, but for python... well. Let's time it: â¶ time ./test
./test 2.28s user 0.00s system 99% cpu 2.285 total The C program took 2.28 seconds. Let's time the Python one (wait for it!): â¶ time ./test.py
./test.py 37.60s user 0.01s system 99% cpu 37.620 total The python program took 37.60 seconds. Wow. Your times may be slightly different, but the difference being large will be the same. In this case, C was 16 times faster . You can see how this gets bad on a larger scale, but I digress. Let's move on to using these languages.
